    private void testJsonResponds(Map<String, Boolean> respondsWithOutputs, boolean arrayTest){
        HttpRequestConnector connector = new HttpRequestConnector();
        for (Map.Entry<String, Boolean> data : respondsWithOutputs.entrySet()) {
            if(arrayTest) {
                assertEquals(connector.jsonResponseIsArray(data.getKey()), data.getValue());
            } else {
                assertEquals(connector.jsonResponseIsJsonObject(data.getKey()), data.getValue());
            }
        }
    }
